import React, { Component } from "react";
class BillsComp extends Component {
  render() {
    return (
      <div className="card card-custom">
        <h6>Bills</h6>
        <p>Min amt due on each of your monthly bills.</p>
      </div>
    );
  }
}

export default BillsComp;
